import React, { Component } from "react"
import PropTypes from "prop-types"
import { withRouter } from "react-router-dom"
import { connect } from "react-redux"
import MetaTags from 'react-meta-tags';
import { withTranslation } from "react-i18next"
import { Table, Thead, Tbody, Tr, Th, Td } from "react-super-responsive-table"
import "react-super-responsive-table/dist/SuperResponsiveTableStyle.css"

//Lightbox
import Lightbox from "react-image-lightbox"
import "react-image-lightbox/style.css"
import img1 from "../../../assets/images/small/img-1.jpg"
import img2 from "../../../assets/images/small/img-2.jpg"
import img3 from "../../../assets/images/small/img-3.jpg"
import img4 from "../../../assets/images/small/img-4.jpg"
import img5 from "../../../assets/images/small/img-5.jpg"
import img6 from "../../../assets/images/small/img-6.jpg"

import {
  Row,
  Col,
  CardBody,
  Card,
  CardText,
  Container,
  Nav,
  NavItem,
  NavLink,
  TabContent,
  TabPane,
  FormGroup,
  Label,
  Input,
  Button
} from "reactstrap"
import classnames from "classnames"
import {
  addNewProject,
  getProjects,
} from "../../../store/projects/actions"

import { AvField, AvForm } from "availity-reactstrap-validation"
import Select from "react-select"
//Import Breadcrumb
import Breadcrumbs from "../../../components/Common/Breadcrumb"
const optionGroup = [
  {

    options: [
      { label: "Test 1", value: "Test 1" },
      { label: "Test 2", value: "Test 2" },
      { label: "Test 3", value: "Test 3" },
      { label: "Test 4", value: "Test 4" }
    ]
  }
]
class ProjectsCreate extends Component {
  constructor(props) {
    super(props)
    this.state = {
      activeTab: "1",
      verticalActiveTab: "1",
      selectedGroup: null,
      photoIndex: 0,
      isFits: false,
      isEffects: false,
      isGallery: false,
      isGalleryZoom: false,
      isOpen: false,

    }
    this.toggle = this.toggle.bind(this)

  }
  toggle(tab) {
    if (this.state.activeTab !== tab) {
      this.setState({
        activeTab: tab,
      })
    }
  }
  render() {
    const { selectedGroup } = this.state
      return (
      <React.Fragment>
        <div className="page-content">

          <MetaTags>
            <title>Create New Project | Realty Space</title>
          </MetaTags>
          <Container fluid>
            {/* Render Breadcrumbs */}
            <Breadcrumbs title={this.props.t("Projects")} breadcrumbItem={this.props.t("Create New Project")} />

            <Row>
              <Col lg="12">
                <Card>
                  <CardBody>
                  <Nav tabs>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "1",
                          })}
                          onClick={() => {
                            this.toggle("1")
                          }}
                        >
                          {this.props.t("Description")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "2",
                          })}
                          onClick={() => {
                            this.toggle("2")
                          }}
                        >
                          {this.props.t("Features")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "3",
                          })}
                          onClick={() => {
                            this.toggle("3")
                          }}
                        >
                          {this.props.t("Contact")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "4",
                          })}
                          onClick={() => {
                            this.toggle("4")
                          }}
                        >
                           {this.props.t("Media")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "5",
                          })}
                          onClick={() => {
                            this.toggle("5")
                          }}
                        >
                           {this.props.t("Gallery")}
                        </NavLink>

                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "6",
                          })}
                          onClick={() => {
                            this.toggle("6")
                          }}
                        >
                          {this.props.t("Payment Plan")}
                        </NavLink>

                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "7",
                          })}
                          onClick={() => {
                            this.toggle("7")
                          }}
                        >
                          {this.props.t("Marketing")}
                        </NavLink>

                      </NavItem>
                    </Nav>

                    <TabContent activeTab={this.state.activeTab} className="p-3 text-muted">
                      <TabPane tabId="1">
                        <Row>
                          <Col sm="12">
                            <CardText className="mb-0">
                            <AvForm className="needs-validation">
                      <Row>
                        <Col md="6">
                          <FormGroup className="mb-3">
                            <Label htmlFor="projectName">
                              {this.props.t("Project Name")}
                            </Label>
                            <AvField
                              name="projectName"
                              placeholder={this.props.t("Project Name")}
                              type="text"
                              errorMessage={this.props.t("Enter Project Name")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="projectName"
                            />
                          </FormGroup>
                        </Col>
                        <Col md="4">
                          <FormGroup className="mb-3">
                            <Label htmlFor="builderName">
                              {this.props.t("Builder Name")}
                            </Label>
                            <Select
                              value={selectedGroup}
                              onChange={this.handleSelectGroup}
                              options={optionGroup}
                              classNamePrefix="select2-selection"
                              id="builderName"
                            />
                          </FormGroup>
                        </Col>
                        <Col md="2">

                        <a href="#"><button type="button" className="btn btn-danger mt20"><i className="bx bx-plus"></i> {this.props.t("Add New")}</button></a>
                        </Col>
                      </Row>

                      <Row>
                        <Col md="6">
                          <FormGroup className="mb-3">
                            <Label htmlFor="completionDate">
                              {this.props.t("Est. Completion  Date")}
                            </Label>
                            <AvField
                              name="completionDate"
                              placeholder={this.props.t("Est. Completion  Date")}
                              type="text"
                              errorMessage={this.props.t("Enter Est. Completion  Date")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="completionDate"
                            />
                          </FormGroup>
                        </Col>
                        <Col md="6">
                          <FormGroup className="mb-3">
                            <Label htmlFor="projectType">
                              {this.props.t("Project Type")}
                            </Label>
                            <Select
                              value={selectedGroup}
                              onChange={this.handleSelectGroup}
                              options={optionGroup}
                              classNamePrefix="select2-selection"
                              id="projectType"
                            />
                          </FormGroup>
                        </Col>



                      </Row>
                      <Row>
                        <Col md="4">
                          <FormGroup className="mb-3">
                            <Label htmlFor="priceRange">
                              {this.props.t("Price Range $")}
                            </Label>
                            <AvField
                              name="priceRange"
                              placeholder={this.props.t("Price Range $")}
                              type="text"
                              errorMessage={this.props.t("Enter Price Range $")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="priceRange"
                            />
                          </FormGroup>
                        </Col>
                        <Col md="4">
                          <FormGroup className="mb-3">
                            <Label htmlFor="noofUnit">
                              {this.props.t("No of Units")}
                            </Label>
                            <AvField
                              name="noofUnit"
                              placeholder={this.props.t("No of Units")}
                              type="text"
                              errorMessage={this.props.t("Enter No of Units")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="noofUnit"
                            />
                          </FormGroup>
                        </Col>

                        <Col md="4">
                          <FormGroup className="mb-3">
                            <Label htmlFor="basePrice">
                              {this.props.t("Base Price")}
                            </Label>
                            <AvField
                              name="basePrice"
                              placeholder={this.props.t("Base Price")}
                              type="text"
                              errorMessage={this.props.t("Enter Base price")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="basePrice"
                            />
                          </FormGroup>
                        </Col>



                      </Row>
                      <Row>
                        <Col md="3">
                          <FormGroup className="mb-3">
                            <Label htmlFor="agentWebsite">
                              {this.props.t("Agent Website")}
                            </Label>
                            <AvField
                              name="agentWebsite"
                              placeholder={this.props.t("Agent Website")}
                              type="text"
                              errorMessage={this.props.t("Enter Agent Website")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="agentWebsite"
                            />
                          </FormGroup>
                        </Col>
                        <Col md="3">
                          <FormGroup className="mb-3">
                            <Label htmlFor="streenName">
                              {this.props.t("Enter Streen Name")}
                            </Label>
                            <AvField
                              name="streenName"
                              placeholder={this.props.t("Enter Streen Name")}
                              type="text"
                              errorMessage={this.props.t("Enter Streen Name")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="streenName"
                            />
                          </FormGroup>
                        </Col>

                        <Col md="3">
                          <FormGroup className="mb-3">
                            <Label htmlFor="cityName">
                              {this.props.t("Enter City")}
                            </Label>
                            <AvField
                              name="cityName"
                              placeholder={this.props.t("Enter City")}
                              type="text"
                              errorMessage={this.props.t("Enter City")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="cityName"
                            />
                          </FormGroup>
                        </Col>

                        <Col md="3">
                          <FormGroup className="mb-3">
                            <Label htmlFor="province">
                              {this.props.t("Enter Province")}
                            </Label>
                            <AvField
                              name="province"
                              placeholder={this.props.t("Enter Province")}
                              type="text"
                              errorMessage={this.props.t("Enter Province")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="province"
                            />
                          </FormGroup>
                        </Col>


                      </Row>

                      <div><button type="submit" className="btn btn-primary w-md float-end">{this.props.t("Save & Continue..")}</button></div>

                      </AvForm>
                            </CardText>
                          </Col>
                        </Row>
                      </TabPane>
                      <TabPane tabId="2">
                        <Row>
                          <Col sm="12">
                            <CardText className="mb-0">
                            <AvForm className="needs-validation">
                      <Row>
                        <Col md="12">
                          <FormGroup className="mb-3">
                            <Label htmlFor="projectSummary">
                              {this.props.t("Project Summary")}
                            </Label>
                            <AvField
                              name="projectSummary"
                              placeholder={this.props.t("Project Summary")}
                              type="textarea"
                              errorMessage={this.props.t("Enter Project Summary")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="projectSummary"
                            />
                          </FormGroup>
                        </Col>

                      </Row>

                      <Row>
                        <Col md="12">
                          <FormGroup className="mb-3">
                            <Label htmlFor="priceFee">
                              {this.props.t("Price & Fee")}
                            </Label>
                            <AvField
                              name="priceFee"
                              placeholder={this.props.t("Price & Fee")}
                              type="textarea"
                              errorMessage={this.props.t("Enter Price & Fee")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="priceFee"
                            />
                          </FormGroup>
                        </Col>

                      </Row>
                      <Row>
                        <Col md="12">
                          <FormGroup className="mb-3">
                            <Label htmlFor="depositStr">
                              {this.props.t("Deposit Structure")}
                            </Label>
                            <AvField
                              name="depositStr"
                              placeholder={this.props.t("Deposit Structure")}
                              type="textarea"
                              errorMessage={this.props.t("Enter Deposit Structure")}
                              className="form-control"
                              validate={{ required: { value: true } }}
                              id="depositStr"
                            />
                          </FormGroup>
                        </Col>

                      </Row>
                      <Row>
                        <Col md="12">
                          <FormGroup className="mb-3">
                            <Label htmlFor="currentIncentive">
                              {this.props.t("Current Incentive")}
                            </Label>
                            <AvField
                              name="currentIncentive"
